//This function will check if all the sequences in one set have the same length
function checkSequences(sequencesToCheck){
    var sequencesOk = true;
    var sequenceArray = sequencesToCheck.split('\n');
    var length = sequenceArray[0].length;
    for(var s = 0; s<sequenceArray.length; s ++){
        if(length != sequenceArray[s].length){

            if(sequenceArray[s].length != 0){
                sequencesOk = false;
                alert(sequenceArray[s] + ' (at line ' + (s+1) +'/' +  sequenceArray.length+' ) is not ' + length + ' amino acids long!');
            }
        }
    }
    return sequencesOk;
}

//This function will check if the sequences from both sets have the same length
function checkLength(sequencePos, sequenceNeg){
    var ok = true;
    var sequenceArrayPos = sequencePos.split('\n');
    var sequenceArrayNeg = sequenceNeg.split('\n');
    if(sequenceArrayNeg.length <= 1){
        alert('You did not give a reference sequence set');
        ok = false;
    }else{
        if(sequenceArrayNeg[0].length != sequenceArrayPos[0].length){
            alert('The length of the peptides in the positive set is not the same\n as the length of the peptides in the negative set!');
            ok = false;
        }
    }

    return ok;
}

//This function will post a request to the logo servlet on the server
function postLogo(){
    var sendRequest = true;
    //get positive set
    var positiveSequences=document.getElementById("positiveSequences").value;
    //check positive set
    var posSeqOk = checkSequences(positiveSequences);
    if(!posSeqOk){
        sendRequest = false;
    }
    if(positiveSequences.length == 0){
        alert('You did not give a experimental sequence set')
        sendRequest = false;
    }
    //get negative set
    var negativeSequences=document.getElementById("negativeSequences").value;
    //get yAxis value
    var yAxis=document.getElementById("yAxis").value;
    //check if yAxis is an integer
    var yAxisOk = /^-?\d+$/.test(yAxis);
    if(!yAxisOk){
        sendRequest = false;
        alert(yAxis + ' is not a valid number');
    }
    if(yAxis == 0){
        sendRequest = false;
        alert(yAxis + ' is not a valid number! This value cannot be 0.' );
    }
    //get start position
    var start=document.getElementById("start").value;
    //check if the start postion is a (negative) integer
    if(start.charAt(0) == '-'){
        //it's a negative number
        // check the substring after the "-" sign.
        var startSub = start.substring(1);
        var startOkMin = /^-?\d+$/.test(startSub);
        if(!startOkMin){
            sendRequest = false;
            alert(start + ' is not a valid number');
        }
    } else {
        //it's not a negative number, check the whole string
        var startOk = /^-?\d+$/.test(start);
        if(!startOk){
            sendRequest = false;
            alert(start + ' is not a valid number');
        }
    }
    //get the pValue
    var pValue=document.getElementById("pValue").value;
    //check pValue
    var pValueOk = true;
    var pointUsed = false;
    for(var p = 0; p<pValue.length; p ++){
        if(pValue.charAt(p) == '.' && !pointUsed){
            pointUsed = true;
        }else {
             var testOk = /^-?\d+$/.test(pValue.charAt(p));
             if(!testOk){
                 pValueOk = false;
             }
        }
    }
    if(pValue >= 1 || pValue<=0){
        sendRequest = false;
        alert(pValue + ' is not a valid number! The P value must be between 0 and 1.');
        //do not send another warning
        pValueOk = true;
    }

    if(!pValueOk){
        alert(pValue + ' is not a valid number!');
        sendRequest = false;
    }
    
    //get the height
    var height=document.getElementById("height").value;
    //check height
    var heightOK = true;
    var pointUsedHeight = false;
    for(var p1 = 0; p1<height.length; p1 ++){
        if(height.charAt(p1) == '.' && !pointUsedHeight){
            pointUsedHeight = true;
        }else {
             var testHeightOk = /^-?\d+$/.test(height.charAt(p1));
             if(!testHeightOk){
                 heightOK = false;
             }
        }
    }

    if(!heightOK){
        alert(height + ' is not a valid number!');
        sendRequest = false;
    }
    
    //get the width
    var width=document.getElementById("width").value;
    //check width
    var widthOK = true;
    var pointUsedwidth = false;
    for(var p1 = 0; p1<width.length; p1 ++){
        if(width.charAt(p1) == '.' && !pointUsedwidth){
            pointUsedwidth = true;
        }else {
             var testwidthOk = /^-?\d+$/.test(width.charAt(p1));
             if(!testwidthOk){
                 widthOK = false;
             }
        }
    }

    if(!widthOK){
        alert(width + ' is not a valid number!');
        sendRequest = false;
    }
    //get the negative set checkboxes
    var negSeqChb=document.getElementById("negSeqChb").value;
    var negSwChb=document.getElementById("negSwChb").value;
    //get the species, aaparam and substitution matrix
    var species=document.getElementById("species").value;
    var aaparamMatrix=document.getElementById("aaMatrix").value;
    var subMatrix=document.getElementById("substitutionMatrix").value;
    //If swissprot composition is selected, check if the given species name is in the list
    if(negSwChb == 'use'){
        var speciesOk = false;
        for(var i = 0; i<my_data['species'].length; i++){
            if(my_data['species'][i] == species){
                speciesOk = true;
            }
        }
        if(!speciesOk){
            alert(species + ' is not a valid species!');
            sendRequest = false;
        }
    } else {// the negative sequences are used as the negative set, check them!
        var negSeqOk = checkSequences(negativeSequences);
        if(!negSeqOk){
            sendRequest = false;
        } else {
            var negSeqLengthOk = checkLength(positiveSequences, negativeSequences);
            if(!negSeqLengthOk){
                sendRequest = false;
            }
        }
    }
    var foldChange=document.getElementById("foldChange").value;
    var percentage=document.getElementById("percentage").value;
    var ComboboxA=document.getElementById("ComboboxA").value;
    var ComboboxC=document.getElementById("ComboboxC").value;
    var ComboboxD=document.getElementById("ComboboxD").value;
    var ComboboxE=document.getElementById("ComboboxE").value;
    var ComboboxF=document.getElementById("ComboboxF").value;
    var ComboboxG=document.getElementById("ComboboxG").value;
    var ComboboxH=document.getElementById("ComboboxH").value;
    var ComboboxI=document.getElementById("ComboboxI").value;
    var ComboboxK=document.getElementById("ComboboxK").value;
    var ComboboxL=document.getElementById("ComboboxL").value;
    var ComboboxM=document.getElementById("ComboboxM").value;
    var ComboboxN=document.getElementById("ComboboxN").value;
    var ComboboxP=document.getElementById("ComboboxP").value;
    var ComboboxQ=document.getElementById("ComboboxQ").value;
    var ComboboxR=document.getElementById("ComboboxR").value;
    var ComboboxS=document.getElementById("ComboboxS").value;
    var ComboboxT=document.getElementById("ComboboxT").value;
    var ComboboxV=document.getElementById("ComboboxV").value;
    var ComboboxW=document.getElementById("ComboboxW").value;
    var ComboboxY=document.getElementById("ComboboxY").value;

    var iceLogoType=document.getElementById("iceLogoType").value;
    if(document.getElementById("iceLogoType").checked){
        iceLogoType = "use";
    } else {
        iceLogoType = "notuse";
    }
    var heatmapType=document.getElementById("heatmapType").value;
    if(document.getElementById("heatmapType").checked){
        heatmapType = "use";
    } else {
        heatmapType = "notuse";
    }
    var sequenceLogoType=document.getElementById("sequenceLogoType").value;
    if(document.getElementById("sequenceLogoType").checked){
        sequenceLogoType = "use";
    } else {
        sequenceLogoType = "notuse";
    }
    var fillLogoType=document.getElementById("fillLogoType").value;
    if(document.getElementById("fillLogoType").checked){
        fillLogoType = "use";
    } else {
        fillLogoType = "notuse";
    }
    var negativeSetCorr= "use";
    var corrLine=document.getElementById("corrLine").value;
    if(document.getElementById("corrLine").checked){
        var corrOk = false;
        for(var i2 = 0; i2<my_data['substitution'].length; i2++){
            if(my_data['substitution'][i2] == subMatrix){
                corrOk = true;
            }
        }
        if(!corrOk){
            alert(subMatrix + ' is not a valid substitution matrix!');
            sendRequest = false;
        }
        corrLine = "use";
    } else {
        corrLine = "notuse";
    }
    var aaparamType=document.getElementById("aaparamType").value;
    if(document.getElementById("aaparamType").checked){
        var aaOk = false;
        for(var i3 = 0; i3<my_data['aa'].length; i3++){
            if(my_data['aa'][i3] == aaparamMatrix){
                aaOk = true;
            }
        }
        if(!aaOk){
            alert(aaparamMatrix + ' is not a valid amino acid parameter matrix!');
            sendRequest = false;
        }
        aaparamType = "use";
    } else {
        aaparamType = "notuse";
    }

    //Check if we have to send the request
    if(sendRequest){
        document['logoImg'].src = "images/ajax-loader.gif";

        //everything seems ok, build the request
        var parm="positiveSequences="+positiveSequences+"&negativeSequences="+negativeSequences + "&yAxis="+yAxis + "&start="+start + "&pValue="+pValue + "&negSeqChb="+negSeqChb+"&negSwChb=" + negSwChb + "&species="+species+"&foldChange="+foldChange+"&percentage="+percentage+"&ComboboxA="+ComboboxA+"&ComboboxC="+ComboboxC+"&ComboboxD="+ComboboxD+"&ComboboxE="+ComboboxE+"&ComboboxF="+ComboboxF+"&ComboboxG="+ComboboxG+"&ComboboxH="+ComboboxH+"&ComboboxI="+ComboboxI+"&ComboboxK="+ComboboxK+"&ComboboxL="+ComboboxL+"&ComboboxM="+ComboboxM+"&ComboboxN="+ComboboxN+"&ComboboxP="+ComboboxP+"&ComboboxQ="+ComboboxQ+"&ComboboxR="+ComboboxR+"&ComboboxS="+ComboboxS+"&ComboboxT="+ComboboxT+"&ComboboxV="+ComboboxV+"&ComboboxW="+ComboboxW+"&ComboboxY="+ComboboxY+"&iceLogoType="+iceLogoType+"&heatmapType="+heatmapType+"&sequenceLogoType="+sequenceLogoType + "&fillLogoType="+fillLogoType + "&negativeSetCorr=" +negativeSetCorr + "&corrLine=" +corrLine + "&subMatrix=" +subMatrix + "&aaparamType=" +aaparamType + "&aaparamMatrix=" +aaparamMatrix + "&height=" + height + "&width=" + width;
        var url = "/icelogoserver/LogoServlet";
        if (window.XMLHttpRequest) {
            req = new XMLHttpRequest();
        }
        else if (window.ActiveXObject) {
            req = new ActiveXObject("Microsoft.XMLHTTP");
        }
        req.onreadystatechange = showLogo;
        req.open("POST", url, true);
        req.setRequestHeader("Content-type", "application/x-www-form-urlencoded");
        req.setRequestHeader("Content-length", parm.length);
        req.setRequestHeader("Connection", "close");
        req.send(parm);
    }

}

//This fucntion shows the logo that is saved on the server.

var imageName;

var iIndex = -1;
var iCounter = -1;
var iPictureTitles = new Array();

function showLogo(){
    if (req.readyState == 4) {
        if (req.status == 200) {
            imageName = req.responseText;
            iCounter = iCounter + 1;
            iIndex = iCounter;
            iPictureTitles[iCounter] = imageName;
            document['logoImg'].src = 'images/logo/' + req.responseText + '.jpeg';
            document.getElementById('savePng').innerHTML = '<a target="_blank" href="images/logo/' + req.responseText + '.png" >Show as png</a>';
            document.getElementById('saveTiff').innerHTML = '<a target="_blank" href="images/logo/' + req.responseText + '.tiff" >Show as tiff</a>';
            document.getElementById('savePdf').innerHTML = '<a target="_blank" href="images/logo/' + req.responseText + '.pdf" >Show as pdf</a>';
            document.getElementById('saveSvg').innerHTML = '<a target="_blank" href="images/logo/' + req.responseText + '.svg" >Show as svg</a>';
            showSave();
        }
    }
}
